import React, { Component } from 'react';
import { Map, TileLayer } from 'react-leaflet';
import SideNav from 'react-simple-sidenav';

const stamenTiles = 'http://{s}.tile.osm.org/{z}/{x}/{y}.png';
const stamenAttr = 'Map tiles by <a href="http://stamen.com">Stamen Design</a>, <a href="http://creativecommons.org/licenses/by/3.0">CC BY 3.0</a> &mdash; Map data &copy; <a href="http://www.openstreetmap.org/copyright">OpenStreetMap</a>';
const mapCenter = [39.9528, -75.1638];
const zoomLevel = 12;

class App extends Component {
    render() {
        return (
            <div>
  <SideNav
    showNav={this.state.showNav3}
    onHideNav={()=>this.setState({showNav3:false})}
    title={<div>Hello octo <img src='git-mark.png' width='26' /></div>}
    titleStyle={{backgroundColor: '#2196F3'}}
    items={[
      <a target='_blank' href='https://github.com/gauravchl/react-simple-sidenav'>View Source on github</a>,
      <a target='_blank' href='https://www.npmjs.com/package/react-simple-sidenav'>Install via npm</a>,
      <a target='_blank' href='https://gauravchl.github.io/react-simple-sidenav/demo/'>demo</a>
      ]} />
                <center>
                <p>Nuestro hermoso proyecto :) </p>
                <Map
                    center={mapCenter}
                    zoom={zoomLevel}>
                    <TileLayer
                        attribution={stamenAttr}
                        url={stamenTiles}
                    />
                </Map>
                </center>
            </div>
        );
    }
}


export default App;
